import WorkExperience from "./components/work-experience";


class App extends Component {
  render() {
    return (
      <div className = "main">
        <Header />
        <PersonalInfo />
        <EducationalExperience />
        <WorkExperience />
        <SubmitButton />
      </div>
    );
  }
}

export default App;
